import { Container, Row, Col, Button } from 'react-bootstrap';
import './TodoList.css';
import TodoItem from '../TodoItem/TodoItem';

function TodoList() {
    return (
        <Container fluid>
            <Row>
                <Col>
                    <div className='header'>
                        <div className='header-title'>
                            <h1>TODO</h1>
                            <img src="../Assests/icon-sun.svg" alt="" />
                        </div>
                    </div>
                </Col>
            </Row>
        </Container>
    );
}

export default TodoList;
